geregisseerd door Shawn Piller
met Michelle Trachtenberg, Katee Sackhoff en Seth Green

Een eclectische groep vreemden wordt uitgenodigd in een bar door een gemenschappelijke ex-geliefde, Nikki Franklyn. Nikki is een sexy, onvoorspelbare en mogelijk krankzinnige jonge vrouw, die onlangs werd vrijgelaten uit de gevangenis voor de moord op haar laatste ex-vriend. Het feest begint pas echt als Nikki zelf aankomt, samen met haar nieuwe minnaar en verloofde, de advocaat die haar zaak behandelde. Ze doet mysterieus over haar intenties en haar huidige en voormalige geliefden beseffen al snel dat ze allemaal gevangen zitten in een van haar briljante, ondeugende spelletjes met mogelijk dodelijke gevolgen.



